package analysis.syntaxtree;import analysis.visitors.TypeVisitor;import analysis.visitors.Visitor;public class IntArrayType implements Type {  private static IntArrayType instance = new IntArrayType();  public static IntArrayType instance() {    return instance;  }  private IntArrayType() { }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }  @Override  public String toString() {    return "int[]";  }}